import React, { useState, useEffect } from 'react';
import { TextField } from '@material-ui/core';
import { Button } from '@material-ui/core';
import axios from 'axios';
import { Dialog } from '@material-ui/core';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogTitle from '@material-ui/core/DialogTitle';

const Title1 = {
    fontSize: '20px',
    color: '#008037',
    fontWeight: 'bold',
    marginLeft: '20px',
    justifyContent: 'center'
}
const Field = {
    marginLeft: '20px',
    width: '500px',
    marginTop: '25px',
    padding: '15px',


}
const buttonstyle = {
    marginLeft: '150px',
    marginTop: '50px',
    backgroundColor: '#008037',
    width: '80px',
    borderRadius: '5px'



}
const PartnersUpdate = (itemupdate) => {
    const [data, setData] = React.useState({
        error: '',
        data: [],
        temp: [],
        error: null,


    });
    const [visible, setVisible] = React.useState(false);
    const handleCancel = () => {
        setVisible(false);
      };
    const [partnerdata, setPartnerdata] = React.useState({
        partnerName: "",
        partnerMail: "",
        phone: "",
        city: "",
        password: ""
    });
    const handleEdit = () => {

        axios.put('https://api.foodealzapi.com/restaurants', partnerdata)

            .then((partnerdata) => {
                console.log(partnerdata);
            })
            .catch(error => {
                console.log(error);
            });
    }



    return (
        <div >
            <div >
                <Dialog style={Title1} aria-labelledby="form-dialog-title">
                    <DialogTitle >Enter new Fields</DialogTitle>
                    <DialogContent>
                        <div style={Field}>
                            <TextField
                                label="Enter partnerName" />

                            <TextField style={{ marginLeft: '50px' }}
                                label="Enter partnerMail" />

                        </div >
                        <div style={Field}>
                            <TextField
                                label="Enter phone" />


                            <TextField style={{ marginLeft: '50px' }}
                                label="Enter city" />
                        </div>

                        <div >
                            <TextField style={{ marginTop: '20px', marginLeft: '25px' }}
                                label="Enter password" />
                        </div>
                    </DialogContent>
                    <DialogActions>
                        <Button onClick={handleCancel()} color="primary">
                            Cancel
</Button>
                        <Button onClick={handleEdit()} color="primary">
                            valider
</Button>
                    </DialogActions>
                </Dialog>
            </div>
            </div>
  )

};

export default PartnersUpdate;
